import { useState } from "react";
import PropTypes from "prop-types";

// @mui material components
import Grid from "@mui/material/Grid";
import Card from "@mui/material/Card";
import { AdapterDayjs } from "@mui/x-date-pickers/AdapterDayjs";
import { LocalizationProvider } from "@mui/x-date-pickers/LocalizationProvider";
import { DatePicker } from "@mui/x-date-pickers/DatePicker";
import dayjs from "dayjs";

// Material Dashboard 2 React components
import MDBox from "components/MDBox";
import MDTypography from "components/MDTypography";
import MDButton from "components/MDButton";
import MDInput from "components/MDInput";

function FilterPanel({ consumers, postcodes, onApply, onReset }) {
  const [consumerId, setConsumerId] = useState("");
  const [postcode, setPostcode] = useState("");
  const [startDate, setStartDate] = useState(null);
  const [endDate, setEndDate] = useState(null);

  const handleApply = () => {
    onApply({
      consumerId,
      postcode,
      startDate: startDate ? startDate.format("YYYY-MM-DD") : "",
      endDate: endDate ? endDate.format("YYYY-MM-DD") : "",
    });
  };

  const handleReset = () => {
    setConsumerId("");
    setPostcode("");
    setStartDate(null);
    setEndDate(null);
    onReset();
  };

  return (
    <Card>
      <MDBox p={3}>
        <MDTypography variant="h6" fontWeight="medium">
          Filter Consumption Data
        </MDTypography>
        <MDBox pt={3}>
          <Grid container spacing={3}>
            <Grid item xs={12} md={6} lg={3}>
              <MDBox mb={2}>
                <select
                  value={consumerId}
                  onChange={(e) => setConsumerId(e.target.value)}
                  className="w-full border rounded-md px-3 py-2"
                >
                  <option value="">All Consumers</option>
                  {consumers.map((c) => (
                    <option key={c.Customer} value={c.Customer}>
                      Consumer {c.Customer}
                    </option>
                  ))}
                </select>
              </MDBox>
            </Grid>
            <Grid item xs={12} md={6} lg={3}>
              <MDBox mb={2}>
                <select
                  value={postcode}
                  onChange={(e) => setPostcode(e.target.value)}
                  className="w-full border rounded-md px-3 py-2"
                >
                  <option value="">All Postcodes</option>
                  {postcodes.map((p) => (
                    <option key={p} value={p}>
                      {p}
                    </option>
                  ))}
                </select>
              </MDBox>
            </Grid>
            <Grid item xs={12} md={6} lg={3}>
              <MDBox mb={2}>
                <LocalizationProvider dateAdapter={AdapterDayjs}>
                  <DatePicker
                    label="Start Date"
                    value={startDate}
                    onChange={(newValue) => setStartDate(newValue)}
                    slotProps={{ textField: { fullWidth: true } }}
                  />
                </LocalizationProvider>
              </MDBox>
            </Grid>
            <Grid item xs={12} md={6} lg={3}>
              <MDBox mb={2}>
                <LocalizationProvider dateAdapter={AdapterDayjs}>
                  <DatePicker
                    label="End Date"
                    value={endDate}
                    onChange={(newValue) => setEndDate(newValue)}
                    slotProps={{ textField: { fullWidth: true } }}
                  />
                </LocalizationProvider>
              </MDBox>
            </Grid>
          </Grid>

          <MDBox display="flex" justifyContent="flex-end" mt={3}>
            <MDBox mr={1}>
              <MDButton variant="outlined" color="info" size="small" onClick={handleReset}>
                Reset
              </MDButton>
            </MDBox>
            <MDButton variant="gradient" color="info" size="small" onClick={handleApply}>
              Apply Filters
            </MDButton>
          </MDBox>
        </MDBox>
      </MDBox>
    </Card>
  );
}

FilterPanel.propTypes = {
  consumers: PropTypes.array.isRequired,
  postcodes: PropTypes.array.isRequired,
  onApply: PropTypes.func.isRequired,
  onReset: PropTypes.func.isRequired,
};

export default FilterPanel;
